const banner1 = require('../assets/imgs/banner1.png')
const banner2 = require('../assets/imgs/banner2.jpg')
const banner3 = require('../assets/imgs/banner3.jpg')
//const LogoSunhouse = require('../assets/imgs/shg-logo.png');
//const BGLogin = require('../assets/imgs/bg-login.jpg');
